css:
.styleguide {
  position: relative;
  display: flex;
  flex-direction: column;
}
.styleguide a {
  text-decoration: underline;
}
.styleguide-controls {
  position: absolute;
  right: 15px;
  top: 15px;
  z-index: 100;
}
.styleguide-header {
  padding: 22.5px;
  border-bottom: 1px solid #313557;
}
.styleguide-header h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: #bea8ce;
}
.styleguide-header p {
  font-size: 1.2em;
}
.styleguide-header p:last-of-type {
  margin-bottom: 0;
}
.styleguide-sections {
  flex: 1;
  overflow: auto;
}
.styleguide-sections > section {
  background-color: #1f2136;
  padding: 0;
  border-bottom: 1px solid #313557;
  border-top: none;
}
.styleguide-sections > section:last-child {
  margin-bottom: 0;
}
.styleguide-sections > section.collapsed {
  background-color: #22253d;
}
.styleguide-sections > section.collapsed > .section-heading {
  display: block;
  margin: 0;
  padding-bottom: 22.5px;
  color: #a3a7cb;
}
.styleguide-sections > section.collapsed > .section-heading:hover {
  color: #bea8ce;
  background-color: #2b2f4d;
}
.styleguide-sections > section.collapsed > .section-heading:active {
  background-color: #22253d;
}
.styleguide-sections > section.collapsed > * {
  display: none;
}
.styleguide-sections .section-heading.section-heading {
  padding: 22.5px 22.5px 0 22.5px;
  cursor: pointer;
  font-weight: normal;
  font-size: 1.8em;
  color: #bea8ce;
}
.styleguide-sections section > h2 {
  font-size: 1.5em;
  line-height: 1.2;
  margin: 1em 22.5px 0 22.5px;
  color: #bea8ce;
}
.styleguide-sections section > p {
  font-size: 1.1em;
  margin: 0.5em 22.5px 1em 22.5px;
}
.styleguide .example {
  display: flex;
  flex-wrap: wrap;
  border-radius: 3px;
  padding: 7.5px;
}
.styleguide .example .example-rendered,
.styleguide .example .example-code {
  position: relative;
  flex: 1 1 300px;
  min-width: 0;
  margin: 7.5px;
  border-radius: 3px;
  border: 1px solid #313557;
}
.styleguide .example .example-rendered {
  padding: 15px;
  background: #22253d;
  overflow: hidden;
}
.styleguide .example .example-code {
  background-color: #313557;
}
.styleguide .example .example-code pre {
  border: none;
  background-color: inherit;
}
